import React from 'react';
import { View } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

import Home from './panels/Home'
import Info from './panels/Info'

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state={}
    }

    render() {
        return (
            <View>
                <Home/>
                <Info/>
            </View>
        )
    }
}

export default App;
